    public static String sendMessageViaChatClient(String url, String message) throws IOException {

        List<Transport> transports = new ArrayList<Transport>(2);
        transports.add(new WebSocketTransport(new StandardWebSocketClient()));
        transports.add(new RestTemplateXhrTransport());
        SockJsClient sockJsClient = new SockJsClient(transports);
        WebSocketStompClient stompClient = new WebSocketStompClient(sockJsClient);
        stompClient.setMessageConverter(new StringMessageConverter());
        WebSocketSession webSocketSession = null;
        MyWebSocketHandler myWebSocketHandler = new MyWebSocketHandler();
        String msg = "";
        try {
            ListenableFuture<WebSocketSession> webSocketSessionListenableFuture = sockJsClient.doHandshake(myWebSocketHandler, url);
            webSocketSession = webSocketSessionListenableFuture.get();
            webSocketSession.sendMessage(getWebSocketMessage(message));
            TimeUnit.SECONDS.sleep(10);


            while (true) {
                msg = myWebSocketHandler.getMessage();

                if (msg != null) {
                    return msg;
                }
                TimeUnit.MILLISECONDS.sleep(20);
            }

            //TimeUnit.SECONDS.sleep(1);
        } catch (Exception ex) {
            ex.printStackTrace();
        } finally {
            if (webSocketSession != null) {
                webSocketSession.close();
            }
        }

        return myWebSocketHandler.getMessage();
    }
   
